contract GasCaller{
    address gas;
    constructor(address _gas) {
        gas = _gas;
    }
    function callForever() public {
        bytes memory cd = abi.encodeWithSignature("forever()");
        (bool suc, bytes memory data) = gas.call{gas: 100000}(cd);
        if(!suc){
            revert("gas not enough");
        }
    }
}

